import "./styles.css";

const Footer = () => {
  const {  theme } = useContext(ContextGlobal);

  return (
    <footer style={{ backgroundColor: theme.navBackground, color: theme.font }}>
      <p>Powered by</p>
      <img src="/images/DH.png" alt="DH-logo" />
    </footer>
  );
};

export default Footer;
